import React, {useEffect} from 'react';
imp
import ItemList from './ItemList';

function ItemListContainer() {
    useEffect(() => {
        fetch('itemlist.json')
        .then((response) => response.json())
        .then((json) => console.log(json))
    })
    return (
        <div>
            <ItemList />
        </div>
    );
};

export default ItemListContainer;
